import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { getFeatureProduct } from '../services/productService';

const Navbar = () => {

  const [featuredProduct, setFeaturedProduct] = useState({});
  const {id} = featuredProduct.id

  useEffect(() => {
    const getData = async () => {
      try {
        const productData = await getFeatureProduct();
        setFeaturedProduct(productData);
      } catch (error) {
        console.log("Error fetching data:", error);
      }
    };

    getData();
  }, []);


  return (
    <div className='pt-6'>
      <nav className='flex font-semibold text-white gap-x-4'>
        <Link to="/">Home</Link>
        <Link to={`/products/${id}`}>Products</Link>
        <Link to="/posts">Posts</Link>
        <Link to="/about">About</Link>
        <Link to="/contact">Contact</Link>
      </nav>
    </div>
  );
};

export default Navbar;
